import React, { FC } from 'react';
import { Header } from '../Header';
import styled from 'styled-components';

const Wrapper = styled.div `
    max-width: 1200px;
    padding: 40px 20px;
    margin: 0 auto;
    display: flex;
    justify-content:center;
    align-items: center;
    flex-direction: column;
`;

interface Props {
    children?: any;
}

export const Layout: FC<Props> = ({ children }) => {
    return (
        <Wrapper>
            <Header />
            { children }
        </Wrapper>
    );
}
